„Marokas sužavėjo savo spalvomis, kvapais, maisto įvairove ir be galo svetingais žmonėmis. Jau nekalbu apie orus, kurie kaip Kanarų salose – „amžinai pavasariški“ – puikūs ištisus metus, – kalbėjo Ignas. – Neabejoju, kad jei Lietuvoje daugiau šviestų saulė, tikrai būtume linksmesni, optimistiškesni ir laimingesni.“ Anot Igno, pasiekti spalvingąjį Maroką kur kas lengviau nei daugelis įsivaizduoja. „Nusidriekusi kelis tūkstančius kilometrų nuo šiaurės į pietus, šalis kontrastinga ir įvairi. Ir dykumos, ir kalnai, ir oazės, ir margaspalviai miestai, ir, žinoma, Atlanto vandenyno bangos, pritraukiančios banglentininkus iš viso pasaulio. Dabar, su tiesoginiu skrydžiu iš Vilniaus į didžiausią kurortą Agadirą, tos vandens ir kitos pramogos ir lietuviams lengviau pasiekiamos“, – pasakojo I. Krupavičius. (function(d, s, i, r) {
